import React from 'react';
import '..'

const Services = ({ data }) => {

    return (
        <div className="container my-5">
            <div className="row ">
                <div className="col-md-4 ">
                    <div className="card-deck ">
                        <div className="card card-book">
                            <img className="card-img mx-auto mt-5 rounded" src={data.image} alt="card" />
                            <div className="card-body text-center mb-2">
                                <h5 className="font-weight-bold">{data.name}</h5>
                                <p className="card-tex">{data.detail}</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Services;
